import React from "react";
import "./Home.css";
import { Link, useLocation } from "react-router-dom";
import { Container } from "react-bootstrap";
import logoIMG from "../Resources/RC_LOGO.png";

function Home() {
  const { pathname } = useLocation();

  // var OiaPic = document.getElementById("OiaImage");
  // OiaPic.src = "src/Pictures/Renke_at_Oia.jpg";

  return (
    <section className="home-page">
      <Container>
        <header className="header">
          <div className="RCLOGO">
            {/* <Link to="/Home" className="text-wrapper-2">
              Renke Cui
            </Link> */}
            {/* <img
              src="src/Resources/RCLOGO.png"
              alt="Renke Cui Logo"
            > </img> */}
            <Link to="/Home">
              <img src={logoIMG} alt="Renke Cui Logo">
              </img>
            </Link>
          </div>
          <div className="btnProjects">
            <Link
              to="/Projects"
              className={`nav-link ${
                pathname.includes("Projects") ? "active" : ""
              }`}
            >
              Projects
            </Link>
          </div>
          <div className="btnAbout">
            <Link
              to="/About"
              className={`button text-wrapper-3${
                pathname.includes("About") ? "active" : ""
              }`}
            >
              About Me
            </Link>
          </div>
        </header>
        <content></content>
      </Container>
    </section>
  );
}

export default Home;
